@prefix lex: <http://example.com/lexical#> .
@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:ATM rdf:type owl:Class .
:Account rdf:type owl:Class .
:Bank rdf:type owl:Class .
:CashCard rdf:type owl:Class .
:Customer rdf:type owl:Class .

:ownsCard rdf:type owl:ObjectProperty ;
          rdfs:domain :Customer ;
          rdfs:range :CashCard .

:belongsToBank rdf:type owl:ObjectProperty ;
               rdfs:domain :ATM ;
               rdfs:range :Bank .

:hasAccount rdf:type owl:ObjectProperty ;
            rdfs:domain :Customer ;
            rdfs:range :Account .

:cardIssuedBy rdf:type owl:ObjectProperty ;
              rdfs:domain :CashCard ;
              rdfs:range :Bank .

:badAccount rdf:type owl:Class .
:sends rdf:type owl:ObjectProperty ;
       rdfs:domain :Bank ;
       rdfs:range :badAccount .

:receives rdf:type owl:ObjectProperty ;
          rdfs:domain :ATM ;
          rdfs:range :badAccount .

:Bank owl:equivalentClass lex:FinancialInstitution .
:ATM owl:equivalentClass lex:AutomatedTellerMachine .
:CashCard owl:equivalentClass lex:BankCard .
:Customer owl:equivalentClass lex:BankCustomer, lex:Person, lex:AccountHolder .
:Account owl:equivalentClass lex:BankAccount .
